import React from "react";
import NavBar from "./NavBar";
import Header from "./Header";
import { DUMMY_CITY } from "./homapage";
import {
  Card,
  CardBody,
  CardImg,
  CardTitle,
  CardText,
  CardImgOverlay,
} from "reactstrap";

const Home = () => {
  return (
    <div>
      <NavBar />
      <Header />
      {/* <div>{DUMMY_CITY[0].name}</div> */}
      <div className="container">
        <div>
          {DUMMY_CITY.map((city) => {
            return (
              <Card className="col-12 col-lg-6 m-1">
                <CardImg src={city.image} width="100%" alt={city.name} />
                <CardImgOverlay>
                  <CardTitle>{city.name}</CardTitle>
                  <CardText>{city.subText}</CardText>
                </CardImgOverlay>
              </Card>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default Home;
